import React from 'react';
import { Switch, Route } from 'react-router-dom';
import Initial from '../pages/initial';

class Routes extends React.Component {
  render() {
    return (

      <Switch>
        <Route exact path="/" component={ Initial } />
      </Switch>
    );
  }
}

export default Routes;
